import * as React from 'react';

const Errors = ({ err }) => {
	console.log('i am error', err);
	err && err && err.map((error, i) => {
		return (
			<p data-test="graphql-error">
				<strong>Shoot!</strong>
				{error.message.replace('GraphQL error: ', '')}
			</p>
		);
	});
};
export default Errors;
